import {Container} from "react-bootstrap";

const Forum = () => {
    return (
        <div>
            <a href={"dasda"} style={{textDecoration:"none",color:"#333333"}} >
               <Container style={{boxShadow:"4px 4px 38px 15px rgba(34, 60, 80, 0.12)",padding:30,borderRadius:50}} className={"mt-5 hover-zoom "} >
                   <div style={{backgroundColor:"#3be0b5", width:"20%",paddingTop:70,borderRadius:20}}></div>
                   <h2>Название темы</h2>
                   Описание темы
               </Container>
            </a>

        </div>
    );
};

export default Forum;
